	(1, 'ATS 500 ML', 6, 100, 20, 'default.png', 7, '379.375.0401.00.01', 'Recolector de fluidos para unidad de terapia V.A.C. ATS. Recolector graduado de cloruro de polivinilo de alta densidad, transparente con capacidad de 500 ml, con graduaciones cada 50 ml en la costilla  del asa, dicho dispositivo contiene un sobre con  substancias químicas, que tienen la propiedad de gelificar el exudado, se encuentra unido a un tubo trac que consta: de 1 lumen central para la recolección de los fluidos de la herida y 4 lúmenes periféricos que transmiten la presión del lecho de la herida al microprocesador de la unidad de terapia  y un cople conector macho, para unirse al tubo de succión del trac. Presentación: pieza.', 0),
	(2, 'CANISTER 500 ML', 24, 100, 20, 'ea43e921cfbdc205eabad526174954dd.png', 7, '379 .375.0500.01.01', 'Recolector de fluidos para unidad de terapia V.A.C. Infovac, activac. Recolector graduado de cloruro de polivinilo de alta densidad, transparente con  capacidad de 500 ml, con graduaciones cada 50 ml en la costilla del asa, dicho dispositivo contiene un sobre con substancias químicas, que tienen la propiedad de gelificar el exudado se encuentra unido a un tubo sensa trac, que consta: de 1 lumen central para la recolección de los fluidos de la herida y 4 lúmenes periféricos que transmiten la presión del lecho de la herida al microprocesador de la unidad de terapia y un cople conector macho, para unirse al tubo de succión del sensa trac. Presentación: pieza. Compatible con unidad de terapia infovac, activac. Presentacion: caja con 5.', 1),
	(3, 'CANISTER 300 ML', 28, 100, 20, '4f273a3cec08bc9a613b703e876f0a4e.png', 7, '379.375.0518.01.01', 'Recolector de fluidos para unidad de terapia V.A.C. Infovac, activac. Recolector graduado de cloruro de polivinilo de alta densidad, transparente con  capacidad de 300 ml, con graduaciones cada 50 ml en la costilla del asa, dicho dispositivo contiene un sobre con substancias químicas, que tienen la propiedad de gelificar el exudado se encuentra unido a un tubo sensa trac, que consta: de 1 lumen central para la recolección de los fluidos de la herida y 4 lúmenes periféricos que transmiten la presión del lecho de la herida al microprocesador de la unidad de terapia y un cople conector macho, para unirse al tubo de succión del sensa trac. Presentación: pieza. Compatible con unidad de terapia infovac, activac. Presentacion: caja con 5.', 1),
	(4, 'CANISTER 1000 ML', 16, 100, 20, '8169d263e0fcab4b909686e732140220.png', 7, '379.375.0526.01.01', 'Recolector de fluidos para unidad de terapia V.A.C. infovac, activac. Recolector graduado de cloruro de polivinilo de alta densidad, transparente con capacidad de 1000 ml, con graduaciones cada 50 ml en la costilla del asa, dicho dispositivo contiene  un sobre con substancias químicas, que tienen la propiedad de gelificar el exudado se encuentra unido a un tubo sensa trac que consta: de 1 lumen central para la recolección de los fluidos de la herida y 4 lúmenes periféricos que transmiten la presion del lecho de la herida al microprocesador de la unidad de terapia y un cople conector macho, para unirse al tubo de succión del sensa trac. Presentación: pieza. Compatible con unidad de terapia infovac, activac. Presentación: caja con 5.', 1),
	(5, 'VERAFLO MEDIANO', 130, 100, 20, '39b496ca9213ce957994c07b1cc74fbc.png', 7, '379.561.1809.00.01', 'Kit V.A.C. veraflo dressing system mediano: contiene 2 apósitos de poliuretano ester reticulado  medium, con porosidad de 400-600 micrones con menor grado de hidrofobicidad ovalado de 18 cm de largo por 12.5 cm de ancho y 3.2 cm de espesor, tres laminas adhesivas avanzadas V.A.C. transparente de 25.7 cm + 2mm con dos zonas de seguridad a lo largo para fácil manejo, desprendibles en los extremos más cortos, con película plástica protectora marcada  con el número 1 y película transparente adherida  marcada con el numero 2; V.A.C. vera T.R.A.C; dos películas de barrera no irritante cavilan  3m; 1 regla de papel para medición de la herida. Todo estéril. Presentación: caja con 5.', 1),
	(6, 'Clavos gigantes', 20, 300, 1, 'default.png', 0, '', '', 1),
	(7, 'VERAFLO CHICO', 30, 100, 20, '1e714bbdeb78da73692e561db548be80.png', 7, '379.561.1817.00.01', 'Kit V.A.C. veraflo dressing system chico: contiene 2 apósito de poliuretano ester reticulado small con porosidad de 400-600 micrones con menor grado de hidrofobicidad ovalado de 10 cm de largo por 7.5 cm de ancho y 3.2 cm de espesor, dos laminas adhesiva avanzadas V.A.C. transparente de 25.7 cm + m con dos zonas de seguridad a lo largo para fácil  manejo, desprendibles en los extremos más cortos, con película plástica protectora marcada con el número 1 y película transparente avanzadas adherida marcada con el numero 2; V.A.C. vera T.R.A.C. ; una película de barrera no irritante cavilon  3m; 1 regla de papel para  medición de la herida. Todo estéril. presentación: caja con 5', 1),
	(8, 'FREEDOM', 59, 100, 20, 'default.png', 7, '379.375.0419.00.01', 'Recolector de fluidos para unidad de terapia V.A.C. freedom. Recolector graduado de cloruro de polivinilo de alta densidad, transparente con capacidad de 300 ml, con graduaciones cada 50 ml en la costilla del asa, dicho dispositivo contiene un sobre con substancias químicas, que tienen la propiedad  de gelificar el exudado, se encuentra unido a un tubo trac que consta de 1 lumen central para la recolección de los fluidos de la herida y 4 lúmenes periféricos que transmiten la presión del lecho de la herida al microprocesador de la unidad de terapia y un cople conector macho, para unirse al tubo de succión del trac. Presentación: pieza.', 0),
	(9, 'tornillos rojos', 0, 150, 150, 'default.png', 0, '', '', 1),
	(10, 'VERAFLO CLEANSE', 0, 100, 20, '5f7f6d4f9052278ecfff16135c6006f0.png', 7, '379.561.1825.00.01', 'KIT V.A.C. veraflocleanse: contiene 1 apósito tubular gris de poliuretano ester con porosidad de 133600 micrones con  grado bajo de hidrofobicidad con fuerza tensil 2.5 veces mayor en seco y 3 veces más húmedo, lo que permite su aplicación en cavitaciones , con perforaciones centrales para facilitar su separación en dos mitades.; 3 películas transparentes avanzadas 3m; 2 películas de barrera no irritante cavilon  3m; 1 regla de papel para  medición de la herida. Todo estéril. Presentación: caja con 5.', 1),
	(11, 'Clavos', 0, 900, 121, 'default.png', 0, '', '', 1),
	(12, 'VERA TRAC DUO', 0, 100, 20, '8a594ccfd360b4de822ae6a8e17f4773.png', 7, '379.561.1833.00.01', 'KIT V.A.C. VERAT.R.A.C. Duo: Tubo desechable configurado con dos  líneas, una proporciona presión negativa y monitorea la presión en el sitio de la herida esta línea se conecta  a la tubería que conduce el exudado hacia el canister que se encuentra en la unidad de terapia ulta. La otra línea ofrece solución para instilación al estar conectado con el cassete de instilación veralink estas líneas se aplican sobre el apósito de espuma en la herida a través  dos almohadillas separadas que se colocan  sobre el apósito, una para fluidos irrigados  y el otro para la entrega de presión negativa. Este diseño permite a los médicos la opción de seleccionar diferentes sitios en la herida cuando se instilar  la solución y donde se elimina (a través de la línea de presión negativa). Presentación: caja con 5.', 1),
	(13, 'BRIDGE', 0, 100, 20, 'a65b214b3d23260ad002731b3cc371b8.png', 7, '379.561.1619.00.01', 'Kit que contiene: 1 apósito para heridas con tratamiento de cierre, heridas de segunda o tercera intención asistido por vacío, permite establecer una extensión del sistema capilar y de vacío en el caso de heridas situadas en regiones anatómicas de carga, facilitando la administración de presión negativa y el retiro de fluidos. Se compone de cuatro módulos: apósito granufoam precortado, es una espuma reticulada de poro abierto de poliuretano colocado directamente en el hueco de la herida; una película drape precortada con orificio de drenaje, integrada por una capa soporte de líneas de liberación de polietileno y de una película portadora elaborada de poliuretano cubierto de adhesivo de acrílico; un módulo puente granu foam con tubería sensa T.R.A.C. el puente está constituido por una capa de contacto con la piel de poliéster-madera, espuma encapsulada de poliuretano encapsulado en una gasa adhesiva; una regla desechable. Kit compatible con equipo infovac, activac. Capaz de detectar 5 alarmas audibles y visibles. Presentación: caja con 10.', 1),
	(15, 'VERALINK CASSETTE', 0, 100, 20, '0ea2c8a4fd07f2a8b4cef333f4eb8961.png', 7, '379.561.1841.00.01', 'KIT V.A.C. VERALINK CASSETTE: Cassette de instilación veralinktm: cassette estéril compatible con unidad de terapia V.A.C. ulta tm desechable que permite la instilación  controlada de la solución directa de  su contenedor original, ajustable a una herida, que cuenta con un tubo de instilación con espiga. Presentación: caja con 5.', 1),
	(16, 'BLANCA GRANDE', 0, 100, 20, '66b13d5331842904ae64e9159e7e8b83.png', 7, '379.328.0144.00.01', 'Esponja de alcohol polivinílico (PVA) para terapia  VAC, de poros cerrados menores de 200 micras, todos interconectados, de color blanco, rectangular de 10 x 15 cm, ideal para heridas tunelizadas, con  exposición de hueso o tendón. Compatible con unidad de terapia ATS. Presentación: pieza.', 1),
	(17, 'ATS 1000 ML', 0, 100, 20, 'default.png', 7, '379.375.0427.00.01', 'Recolector de fluidos para unidad de terapia V.A.C. ATS. Recolector graduado de cloruro de polivinilo de alta densidad, transparente con capacidad de 1000 ml, con graduaciones cada 50 ml en la costilla del asa, dicho dispositivo contiene un sobre con substancias químicas, que tienen la propiedad de gelificar el exudado, se encuentra unido a un tubo trac que consta de 1 lumen central para la recolección de los fluidos de la herida y 4 lúmenes periféricos que transmiten la presión del lecho de la herida al microprocesador de la unidad de terapia  y un cople conector macho, para unirse al tubo de succión del trac. Presentación: pieza.', 1),
	(18, 'NEGRA MEDIANA', 0, 100, 20, '938f53d4d7459b000ad57c32790e6179.png', 7, '379.561.0900.00.01', 'Un kit que contiene: 1 apósito de espuma fabricado  con poliuretano reticulado (PU) grado médico, hidrofóbico de poro abierto, con orificios de 400 a 600 micras, todos interconectados, de color negro, ovalado, de 18 cm de largo por 12.5 cm de ancho y 3.2 cm de espesor; 2 películas de poliuretano adhesivo transparente de 25.7cm +/- 2 mm por 32 cm +/2 mm con dos zonas de seguridad a lo largo para fácil manejo de color azul desprendibles en los extremos más cortos, con película plástica protectora marcada con el número 1 y película transparente adherida marcada con el numero 2; con un trac pad de silicón en uno de sus extremos auto adherible de forma circular unido a un tubo de succión de que contiene 5 lúmenes, 1 lumen central para recolecta r el exudado de la herida al canister y 4 lúmenes periféricos que transmiten la presión del lecho de la herida al microprocesador de la unidad de terapia, y en el extremo opuesto un cople conector hembra para unirse al tubo de succión del canister. Kit compatible con unidad de terapia ATS. Presentación: pieza.', 1),
