	(32, 'RENASYS EZ PLUS 800 ML', 0, 100, 20, 'default.png', 7, '379.274.0023.00.01', 'Depósito recolector de fluidos para  equipo de Terapia de Presión Negativa  Renasys EZ Plus, de 800 ml, graduaciones cada 100 ml,  con sellado, filtro anti-desbordamiento, tubo de conexión a equipo de terapia de presión negativa, tubo de conexión a drenaje, saco gelificante de agar y filtro de entrada al sistema. Pieza.', 1),
	(33, 'RENASYS EZ PLUS 250 ML', 0, 100, 20, 'default.png', 7, '379.274.0031.00.01', 'Depósito recolector de fluídos para Renasys EZ Plus,  de 250 ml, graduaciones cada 100 ml, con sellado,   filtro anti-desbordamiento, tubo de conexión a equipo de terapia de presión negativa, tubo de conexión a drenaje, saco gelificante de agar, y filtro de entrada al sistema. Pieza', 1),
	(34, 'RENASYS GO 300 ML', 0, 100, 20, 'default.png', 7, '379.274.0049.00.01', 'Depósito recolector de fluidos para Renasys GO de 300 ml, con filtro anti-desbordamiento, tubo de conexión terapia de presión negativa ambulatoria, tubo de conexión a drenaje, saco gelificante de agar, y filtro de entrada a equipo portable. Pieza', 1),
	(35, 'RENASYS EZ PLUS O RENASYS GO  BLANCO', 0, 100, 20, 'default.png', 7, '379.360.3493.00.01', 'Puerto de succión suave  Renasys EZ Plus o Renasys GO de color blanco con único sistema capaz de eliminar el exudado y aplicar presión negativa en la herida bajo compresión directa, con estructura interior en forma de arco que da consistencia al drenaje y evita que se obstruya. A prueba de pliegues y torsiones, con vía de aireación compuesta por espuma de poliuretano. Pieza.', 1),
	(36, '379.561.1908.00.01', 0, 100, 20, 'default.png', 7, '379.561.1908.00.01', 'Paquete Pequeño que incluye una gasa de 15cm x 17cm 100% algodón maleable antimicrobiana impregnada con polihexametileno de biguanida al 0.02%  para heridas irregulares y con cavitaciones, puerto de succión suave con sistema de sellado resistente a la compresión, una película transparente con alta transmisión de vapor de agua, una ampolleta de solución salina de 30 ml, medidor de herida, gasa no adherente impregnada de aceite mineral  de 7 x 7 cm y una toallita de preparación cutánea. Para uso con equipo Renasys EZ Plus y GO.', 1),
	(37, '379.561.1916.00.01', 0, 100, 20, 'default.png', 7, '379.561.1916.00.01', 'Paquete Mediano que incluye dos gasas de 15cm x 17cm 100% algodón maleable antimicrobianas impregnadas con polihexametileno de biguanida al 0.02%  para heridas irregulares y con cavitaciones, puerto de succión suave con sistema de sellado resistente a la compresión, una película transparente con alta transmisión de vapor de agua, una ampolleta de solución salina de 30 ml, medidor de herida, gasa no adherente impregnada de aceite mineral de 7 x 7 cm  y una toallita de preparación cutánea. Para uso con el equipo Renasys EZ plus y Renasys GO. Paquete', 1),
	(38, '379.561.1924.00.01', 0, 100, 20, 'default.png', 7, '379.561.1924.00.01', 'Paquete Grande que incluye un rollo de gasa de 11.4cm x 3.7metros 100% algodón maleable antimicrobiana impregnada con polihexametileno de biguanida al 0.02%  para heridas irregulares y con cavitaciones, puerto de succión suave con sistema de sellado resistente a la compresión, una película transparente con alta transmisión de vapor de agua, una ampolleta de solución salina de 30 ml, medidor de herida, gasa no adherente impregnada de aceite mineral de 7 x 7 cm  y una toallita de preparación cutánea. Para uso con el equipo Renasys EZ plus y Renasys GO. Paquete.', 1),
	(39, '379.561.1932.00.01', 0, 100, 20, 'default.png', 7, '379.561.1932.00.01', 'Paquete Extra-Grande que incluye dos rollos de gasa de 11.4cm x 3.7metros 100% algodón maleable antimicrobiana impregnada con polihexametileno de biguanida al 0.02%  para heridas irregulares y con cavitaciones, puerto de succión suave con sistema de sellado resistente a la compresión, una película transparente con alta transmisión de vapor de agua, una ampolleta de solución salina de 30 ml, medidor de herida, gasa no adherente impregnada de aceite mineral de 7 x 7 cm y una toallita de preparación cutánea. Para uso con el equipo Renasys EZ plus y Renasys GO. Paquete.', 1),
	(40, '379.561.1940.00.01', 0, 100, 20, 'default.png', 7, '379.561.1940.00.01', 'Paquete Pequeño: incluye una espuma de poliuretano de 400 a 600 micras de porosidad de forma rectangular de 10cm x 8cm x 3cm, un puerto de succión suave  con sistema de sellado resistente a la compresión y un apósito de marco de ventana para fijación, con una película transparente de 20cm x 30cm con  indicadores numéricos para su fácil aplicación con alta transmisión de vapor de agua. Paquete.', 1),
	(41, '379.561.1957.00.01', 0, 100, 20, 'default.png', 7, '379.561.1957.00.01', 'Paquete  Mediano: incluye una espuma de poliuretano de 400 a 600 micras de porosidad de forma rectangular de 20cm x 12.5cm x 3cm, un puerto de succión suave con sistema de sellado resistente a la compresión y un apósito de marco de ventana para fijación, con dos películas transparentes de 20cm x 30cm con  indicadores numéricos para su fácil aplicación con alta transmisión de vapor de agua. Paquete.', 1),
	(42, '379.561.1965.00.01', 0, 100, 20, 'default.png', 7, '379.561.1965.00.01', 'Paquete  Grande: incluye una espuma de poliuretano de 400 a 600 micras de porosidad de forma rectangular de 25cm x 15cm x 3cm, un puerto de succión suave con sistema de sellado resistente a la compresión y un apósito de marco de ventana para fijación, con tres películas transparentes de 20cm x 30cm con  indicadores numéricos para su fácil aplicación con alta transmisión de vapor de agua. Paquete.', 1),
	(43, 'ABTHERA', 0, 100, 20, 'de6806a134edf9cb8b167ba257b6ea6e.png', 7, '379.561.1411.00.01', 'Un  kit que contiene: 1 apósito para abdomen abierto, abthera TM sensa T.R.A.C. TM, consta de una capa protectora visceral (VPL), capa de contacto elaborada a base de dos películas de poliuretano fenestradas de manera balanceada con un espesor de 160 micrones de forma oval de dimensiones de 665 a 802 mm y una esponja encapsulada con un grosor de 10 mm, en forma de estrella estéril, libre de látex. Dos piezas de espuma perforadas, las cuales están hechas a base de espuma de célula abierta de poliuretano de forma oval, el tama¾o del poro es de 500 a 600 micras. Cuatro apósitos adhesivos, cuentan con una película de apoyo y recubrimiento de liberación, elaborada de polietileno y una película portadora de adhesivo de acrílico no sensibilizante, recubierto de poliuretano. Un T.R.A.C. therapeutic regulated accurate care, un microprocesador avanzado de control de presión, que junto con un tubo multilúmen ayuda a asegurar la precisión del sistema V.A.C.  kit compatible con unidad de terapia ATS, infovac, activac. Presentación: pieza.', 1),
